 (62, '2011-05-24 14:49:13.0', '<p>\n\t<span><strong><u>NX Bank</u></strong></span> should be accessible through :</p>\n<ul>\n\t<li>\n\t\tFirefox 4.0.x</li>\n\t<li>\n\t\tInternet Explorer 7.0.x</li>\n</ul>\n<p>\n\tOther browser or older versions are <span>NOT</span> allowed.</p>\n', 'Browser', 'nf', '2011-05-17 15:12:44.0', 'nf', '2011-05-24 12:32:25.0', 2), 
 (63, '2011-05-24 14:49:13.0', '<p>\n\tOnly a user with a <strong>banker</strong> profile can access to <span><strong><u>NX Bank</u></strong></span>.</p>\n<p>\n\t</p>\n<p>\n\t<u>Note :</u> <em>Check the admin to figure how to declare a profile.</em></p>\n', 'Authorisation', 'nf', '2011-05-17 15:28:16.0', 'nf', '2011-05-24 12:32:21.0', 2), 
 (64, '2011-05-24 14:49:13.0', '<p>\n\tA <strong>banker</strong> must enter his login and password then click on <span>VALIDATE</span> to enter <span _fck_bookmark=\"1\"></span><u><strong><span><span><span _fck_bookmark=\"1\"></span></span></span></strong></u><span><span _fck_bookmark=\"1\"></span><span _fck_bookmark=\"1\"> </span><strong><u>NX Bank</u></strong></span>.</p>\n', 'Navigation', 'nf', '2011-05-17 15:30:28.0', 'nf', '2011-05-24 12:32:45.0', 2), 
 (65, '2011-05-24 14:49:13.0', '<p>\n\tThe graphic interface of this screen is composed by <em><span>five</span></em><strong> (5) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA banner with label <span>JPetStore Bank</span></li>\n\t<li>\n\t\tA label <span>Please enter your login and password.</span></li>\n\t<li>\n\t\tA text box with label <span>Login :</span></li>\n\t<li>\n\t\tA text box with label <span>Password :</span></li>\n\t<li>\n\t\tA button <span>VALIDATE</span></li>\n</ol>\n', 'Interface', 'nf', '2011-05-17 15:47:27.0', 'nf', '2011-05-24 12:32:41.0', 2), 
 (66, '2011-05-17 16:52:33.0', '', 'Navigation', 'nf', '2011-05-17 15:54:54.0', null, null, 2), 
 (67, '2011-05-24 14:49:37.0', '<p>\n\t<span class=\"short_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">A</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">click</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">on</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the</span> <span>REGISTER</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">button</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">will open</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">a</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">form page.</span></span></p>\n', 'Opening a page form', 'anonymousUser', '2011-05-17 16:05:05.0', 'nf', '2011-05-24 12:35:22.0', 1), 
 (68, '2011-05-24 14:49:13.0', '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA wrong / incomplete / too long login or password should display the following <span>error messages</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Wrong - login :</u> Sorry, wrong login. Try again with the right one or contact your administrator.</li>\n\t<li>\n\t\t<u>Wrong password :</u> Sorry, wrong password. Try again with the right one or contact your administrator.</li>\n</ul>\n', 'Wrong Login Password', 'nf', '2011-05-17 16:53:06.0', 'nf', '2011-05-24 12:32:50.0', 2), 
 (69, '2011-05-24 14:49:13.0', '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA missing login or password should display the following <span>error messages</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Missing login :</u> Sorry, wrong login. Try again with the right one or contact your administrator.</li>\n\t<li>\n\t\t<u>Missing password :</u> Sorry, wrong password. Try again with the right one or contact your administrator.</li>\n</ul>\n', 'Incomplete Login Password', 'nf', '2011-05-17 16:56:44.0', 'nf', '2011-05-24 12:32:37.0', 2), 
 (70, '2011-05-24 14:49:13.0', '<p>\n\tBoth text boxes are limited to <strong><em>twelve </em>(12)</strong> characters.</p>\n', 'Controls', 'nf', '2011-05-17 17:01:00.0', 'nf', '2011-05-24 12:32:32.0', 2), 
 (71, '2011-05-24 14:49:13.0', '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA <strong>Non Banker</strong> profile (all other than <strong>Banker</strong>) should display the following <span>error message</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Non banker :</u> Sorry, wrong profile. Youre not allowed to enter. Please contact your administrator for further informations.</li>\n</ul>\n', 'Wrong profile', 'nf', '2011-05-17 17:14:37.0', 'nf', '2011-05-24 12:32:54.0', 2), 
 (72, '2011-05-24 14:49:37.0', '<p>\n\t<span id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\"><span>MyAccount</span></span> link <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">is not</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">accessible</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">directly</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">from</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the homepage</span></span></p>\n', 'MyAccount Link', 'id', '2011-05-18 09:12:27.0', 'nf', '2011-05-24 12:35:06.0', 1), 
 (73, '2011-05-18 15:30:17.0', '<div class=\"ui-accordion-content ui-helper-reset ui-widget-content ui-corner-bottom ui-accordion-content-active\">\n\t<div id=\"requirement-description\">\n\t\t<p>\n\t\t\tThe graphic interface of this screen is composed by <em><span>five</span></em><strong> (5) </strong>elements :</p>\n\t\t<ol>\n\t\t\t<li>\n\t\t\t\tA banner with label <span>JPetStore Bank</span></li>\n\t\t\t<li>\n\t\t\t\tA sub banner with label <span>All payments</span></li>\n\t\t\t<li>\n\t\t\t\tA text <span>Card data checked</span> may appears during the time needed for a payment check.</li>\n\t\t\t<li>\n\t\t\t\tA table where all payments appears</li>\n\t\t\t<li>\n\t\t\t\tThe titles for the columns are :</li>\n\t\t</ol>\n\t\t<ul>\n\t\t\t<li>\n\t\t\t\tOrder ID</li>\n\t\t\t<li>\n\t\t\t\tDate</li>\n\t\t\t<li>\n\t\t\t\tItem ID</li>\n\t\t\t<li>\n\t\t\t\tTotal Cost</li>\n\t\t\t<li>\n\t\t\t\tCard number</li>\n\t\t\t<li>\n\t\t\t\tExpiry date</li>\n\t\t\t<li>\n\t\t\t\tCheck =<span> by default, at the first connection the button <strong>+</strong> appears in all payments.</span></li>\n\t\t\t<li>\n\t\t\t\tReason</li>\n\t\t</ul>\n\t</div>\n</div>\n', 'Interface', 'nf', '2011-05-18 14:11:55.0', 'anonymousUser', '2011-05-18 15:30:05.0', 2), 
 (74, '2011-05-18 15:33:09.0', '<p>\n\tTo get back to the Authorisation screen, click on :</p>\n<ul>\n\t<li>\n\t\tthe parrot icon.</li>\n\t<li>\n\t\tthe JPetStore in the upper banner.</li>\n</ul>\n', 'Navigation', 'nf', '2011-05-18 14:12:11.0', 'anonymousUser', '2011-05-18 15:08:49.0', 2), 
 (75, '2011-05-18 15:27:10.0', '<p>\n\tThis module is designed to :</p>\n<ol>\n\t<li>\n\t\t<span><strong>list all the payments</strong></span> made for the NX Pet Shop.</li>\n\t<li>\n\t\tcheck if a <span _fck_bookmark=\"1\"></span><span><strong>card number</strong></span><span _fck_bookmark=\"1\"></span> is <span><strong>valid</strong></span>.<span _fck_bookmark=\"1\"></span></li>\n\t<li>\n\t\tcheck if the <span><strong>expire date</strong></span> of a card has been <span><strong>reached</strong></span>.</li>\n</ol>\n', 'Goal', 'anonymousUser', '2011-05-18 15:01:59.0', 'anonymousUser', '2011-05-18 15:05:40.0', 2), 
