 (81, '2011-05-18 15:31:01.0', '<div class=\"ui-accordion-content ui-helper-reset ui-widget-content ui-corner-bottom ui-accordion-content-active\">\n\t<div id=\"requirement-description\">\n\t\t<p>\n\t\t\tThe graphic interface of this screen is composed by <em><span>five</span></em><strong> (5) </strong>elements :</p>\n\t\t<ol>\n\t\t\t<li>\n\t\t\t\tA banner with label <span>JPetStore Bank</span></li>\n\t\t\t<li>\n\t\t\t\tA sub banner with label <span>All payments</span></li>\n\t\t\t<li>\n\t\t\t\tA text <span>Card data checked</span> may appears during the time needed for a payment check.</li>\n\t\t\t<li>\n\t\t\t\tA table where all payments appears</li>\n\t\t\t<li>\n\t\t\t\tThe titles for the columns are :</li>\n\t\t</ol>\n\t\t<ul>\n\t\t\t<li>\n\t\t\t\tOrder ID</li>\n\t\t\t<li>\n\t\t\t\tDate</li>\n\t\t\t<li>\n\t\t\t\tItem ID</li>\n\t\t\t<li>\n\t\t\t\tTotal Cost</li>\n\t\t\t<li>\n\t\t\t\tCard number</li>\n\t\t\t<li>\n\t\t\t\tExpiry date</li>\n\t\t\t<li>\n\t\t\t\tCheck =<span> by default, at the first connection the button <strong>+</strong> appears in all payments.</span></li>\n\t\t\t<li>\n\t\t\t\tReason</li>\n\t\t</ul>\n\t</div>\n</div>\n', 'Interface', 'anonymousUser', '2011-05-18 15:30:29.0', null, null, 2), 
 (82, '2011-05-24 14:49:13.0', '<p>\n\tThe graphic interface of this screen is composed by <strong><em>five </em>(5)</strong> elements :</p>\n<ol>\n\t<li>\n\t\t A banner with label J<span>PetStore Bank</span></li>\n\t<li>\n\t\t A sub banner with label <span>All payments</span></li>\n\t<li>\n\t\t A text <span>Card data checked</span> may appears during the time needed for a payment check.</li>\n\t<li>\n\t\t A table where all payments appears</li>\n\t<li>\n\t\t The titles for the columns are :</li>\n</ol>\n<ul>\n\t<li>\n\t\tOrder ID</li>\n\t<li>\n\t\tDate</li>\n\t<li>\n\t\tItem ID</li>\n\t<li>\n\t\tTotal Cost</li>\n\t<li>\n\t\tCard number</li>\n\t<li>\n\t\tExpiry date</li>\n\t<li>\n\t\tCheck <span><span>= by default, at the first connection the button + appears in all payments.</span></span></li>\n\t<li>\n\t\tReason <span><span>= by default, at the first connection the reason is empty.</span></span></li>\n</ul>\n', 'Interface', 'nf', '2011-05-18 15:31:43.0', 'nf', '2011-05-24 12:33:59.0', 2), 
