 (89, '2011-05-24 14:49:13.0', '<p>\n\tThe check result do several things :</p>\n<ul>\n\t<li>\n\t\tThe <span><span><strong>+</strong></span></span> button disappears.</li>\n</ul>\n<p>\n\tAnd it is replaced by an icon, depending on the result of the check success or failed :</p>\n<ul>\n\t<li>\n\t\t<strong><span>V</span></strong> for successful check.</li>\n\t<li>\n\t\t<strong><span>X</span></strong> for failed check.</li>\n</ul>\n<p>\n\tIf it passes both date and card number, it is considered success.</p>\n<p>\n\t</p>\n<p>\n\tIf the check fails on either date or card number, it is considered failed.</p>\n<p>\n\t</p>\n<p>\n\tThen, depending on the criteria, a text is displayed in the reason column :</p>\n<ul>\n\t<li>\n\t\t<u>Date fails :</u> <span>date expires</span></li>\n\t<li>\n\t\t<u>Card number fails :</u> <span>invalid card number</span></li>\n</ul>\n', 'Check result', 'nf', '2011-05-18 15:49:15.0', 'nf', '2011-05-24 12:33:37.0', 2), 
