 (104, '2011-05-24 14:49:37.0', '<p>\n\tClicking on :</p>\n<ol>\n\t<li>\n\t\tthe horizontal link bar sends to the <span>Catalogue</span> screen.</li>\n\t<li>\n\t\the menu sends to each animal <span>Catalogue</span> screen.</li>\n\t<li>\n\t\tthe parrot sends to each animal <span>Catalogue</span> screen.</li>\n\t<li>\n\t\tthe cart sends to the Cart screen.</li>\n\t<li>\n\t\tthe <span>Sign-in</span> link sends to the <span>Authorisation</span> screen.</li>\n\t<li>\n\t\tSearch with a name written down in the text field sends to the <span>Detailed Catalogue</span> screen.</li>\n\t<li>\n\t\tthe ? sends to the Help screen.</li>\n</ol>\n', 'Navigation - Welcome', 'nf', '2011-05-19 17:15:15.0', 'nf', '2011-05-24 12:35:18.0', 1), 
 (105, '2011-05-24 14:49:37.0', '<p>\n\tClicking on :</p>\n<ol>\n\t<li>\n\t\twith the default user login : the SUBMIT button sends to the <span>Homepage</span> screen.</li>\n\t<li>\n\t\twith a new user login : the REGISTER NOW button sends to the <span>User information</span> screen.</li>\n</ol>\n', 'Navigation - Authorisation', 'nf', '2011-05-19 17:18:00.0', 'nf', '2011-05-24 12:35:09.0', 1), 
