 (120, '2011-05-24 14:49:37.0', '<p>\n\tThe user initiate a search :</p>\n<ol>\n\t<li>\n\t\tWith something written down in the text box.</li>\n\t<li>\n\t\tBy clicking on <span>Search</span> OR hitting <span>Enter</span>. If the text box is empty, nothing happens.</li>\n</ol>\n', 'Initiate a search', 'nf', '2011-05-23 15:42:56.0', null, null, 1), 
