 (122, null, '<p>\n\tThe graphic interface of this screen is composed by <em><span>five</span></em><strong> (5) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA banner with label <span>JPetStore Bank</span></li>\n\t<li>\n\t\tA label <span>Please enter your login and password.</span></li>\n\t<li>\n\t\tA text box with label <span>Login :</span></li>\n\t<li>\n\t\tA text box with label <span>Password :</span></li>\n\t<li>\n\t\tA button <span>VALIDATE</span></li>\n</ol>\n', 'Interface', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:30.0', 2), 
 (123, null, '<p>\n\t<span><strong><u>NX Bank</u></strong></span> should be accessible through :</p>\n<ul>\n\t<li>\n\t\tFirefox 4.0.x</li>\n\t<li>\n\t\tInternet Explorer 7.0.x</li>\n</ul>\n<p>\n\tOther browser or older versions are <span>NOT</span> allowed.</p>\n', 'Browser', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:19.0', 2), 
 (124, null, '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA wrong / incomplete / too long login or password should display the following <span>error messages</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Wrong - login :</u> Sorry, wrong login. Try again with the right one or contact your administrator.</li>\n\t<li>\n\t\t<u>Wrong password :</u> Sorry, wrong password. Try again with the right one or contact your administrator.</li>\n</ul>\n', 'Wrong Login Password', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:41.0', 2), 
 (125, null, '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA missing login or password should display the following <span>error messages</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Missing login :</u> Sorry, wrong login. Try again with the right one or contact your administrator.</li>\n\t<li>\n\t\t<u>Missing password :</u> Sorry, wrong password. Try again with the right one or contact your administrator.</li>\n</ul>\n', 'Incomplete Login Password', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:27.0', 2), 
 (126, null, '<p>\n\tA <strong>banker</strong> must enter his login and password then click on <span>VALIDATE</span> to enter <span _fck_bookmark=\"1\"></span><u><strong><span><span><span _fck_bookmark=\"1\"></span></span></span></strong></u><span><span _fck_bookmark=\"1\"></span><span _fck_bookmark=\"1\"> </span><strong><u>NX Bank</u></strong></span>.</p>\n', 'Navigation', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:37.0', 2), 
 (127, null, '<p>\n\tWhen click on <span>VALIDATE</span> :</p>\n<p>\n\t</p>\n<p>\n\tA <strong>Non Banker</strong> profile (all other than <strong>Banker</strong>) should display the following <span>error message</span> :</p>\n<ul>\n\t<li>\n\t\t<u>Non banker :</u> Sorry, wrong profile. Youre not allowed to enter. Please contact your administrator for further informations.</li>\n</ul>\n', 'Wrong profile', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:44.0', 2), 
