 (129, null, '<p>\n\tOnly a user with a <strong>banker</strong> profile can access to <span><strong><u>NX Bank</u></strong></span>.</p>\n<p>\n\t</p>\n<p>\n\t<u>Note :</u> <em>Check the admin to figure how to declare a profile.</em></p>\n', 'Authorisation', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:13.0', 2), 
 (130, null, '', '02_Verify a payment', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 14:48:57.0', 2), 
 (131, null, '<p>\n\tThe check result do several things :</p>\n<ul>\n\t<li>\n\t\tThe <span><span><strong>+</strong></span></span> button disappears.</li>\n</ul>\n<p>\n\tAnd it is replaced by an icon, depending on the result of the check success or failed :</p>\n<ul>\n\t<li>\n\t\t<strong><span>V</span></strong> for successful check.</li>\n\t<li>\n\t\t<strong><span>X</span></strong> for failed check.</li>\n</ul>\n<p>\n\tIf it passes both date and card number, it is considered success.</p>\n<p>\n\t</p>\n<p>\n\tIf the check fails on either date or card number, it is considered failed.</p>\n<p>\n\t</p>\n<p>\n\tThen, depending on the criteria, a text is displayed in the reason column :</p>\n<ul>\n\t<li>\n\t\t<u>Date fails :</u> <span>date expires</span></li>\n\t<li>\n\t\t<u>Card number fails :</u> <span>invalid card number</span></li>\n</ul>\n', 'Check result', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:04.0', 2), 
 (132, null, '<p>\n\tEach payment made and confirmed feeds the database.</p>\n<p>\n\t</p>\n<p>\n\tThis feature reads these datas.</p>\n<p>\n\t</p>\n<p>\n\t<u>Note :</u> <em>For more details, check the requirements of NX Pet Shop :</em></p>\n<p>\n\t</p>\n<p>\n\t<span><em>05_Manage the basket / Flow to NS Bank</em></span></p>\n', 'Flow from NX Pet Shop', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:13.0', 2), 
 (133, null, '<p>\n\tThis module is designed to :</p>\n<ul>\n\t<li>\n\t\t<span><strong>List all the payments</strong></span> made for the NX Pet Shop.</li>\n</ul>\n', 'List all payments', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:22.0', 2), 
 (134, null, '<p>\n\tTo get back to the Authorisation screen, click on :</p>\n<ul>\n\t<li>\n\t\tthe parrot icon.</li>\n\t<li>\n\t\tthe JPetStore in the upper banner.</li>\n</ul>\n', 'Navigation', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:25.0', 2), 
