 (137, null, '<p>\n\tThis module is designed to :</p>\n<ul>\n\t<li>\n\t\tCheck if a <span><strong>card number</strong></span> is <span><strong>valid</strong></span>.</li>\n</ul>\n<p>\n\tIf it fails, this icon appears :</p>\n<ul>\n\t<li>\n\t\t<strong><span>X</span></strong> for failed check.</li>\n</ul>\n<p>\n\tand a text is displayed in the reason column :</p>\n<ul>\n\t<li>\n\t\t<u>Card number fails :</u> <span>invalid card number</span></li>\n</ul>\n', 'Check number', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:00.0', 2), 
 (138, null, '<p>\n\tThis module is designed to :</p>\n<ul>\n\t<li>\n\t\tCheck if the <span><strong>expire date</strong></span> of a card has been <span><strong>reached</strong></span>.</li>\n</ul>\n<p>\n\tIf it fails, this icon appears :</p>\n<ul>\n\t<li>\n\t\t<strong><span>X</span></strong> for failed check.</li>\n</ul>\n<p>\n\tand a text is displayed in the reason column :</p>\n<ul>\n\t<li>\n\t\t<u>Date fails :</u> <span>date expires</span></li>\n</ul>\n', 'Check date', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:26:54.0', 2), 
 (139, null, '<p>\n\tThe graphic interface of this screen is composed by <strong><em>five </em>(5)</strong> elements :</p>\n<ol>\n\t<li>\n\t\t A banner with label J<span>PetStore Bank</span></li>\n\t<li>\n\t\t A sub banner with label <span>All payments</span></li>\n\t<li>\n\t\t A text <span>Card data checked</span> may appears during the time needed for a payment check.</li>\n\t<li>\n\t\t A table where all payments appears</li>\n\t<li>\n\t\t The titles for the columns are :</li>\n</ol>\n<ul>\n\t<li>\n\t\tOrder ID</li>\n\t<li>\n\t\tDate</li>\n\t<li>\n\t\tItem ID</li>\n\t<li>\n\t\tTotal Cost</li>\n\t<li>\n\t\tCard number</li>\n\t<li>\n\t\tExpiry date</li>\n\t<li>\n\t\tCheck <span><span>= by default, at the first connection the button + appears in all payments.</span></span></li>\n\t<li>\n\t\tReason <span><span>= by default, at the first connection the reason is empty.</span></span></li>\n</ul>\n', 'Interface', 'nf', '2011-05-24 14:48:57.0', 'nf', '2011-05-24 15:27:18.0', 2), 
 (140, null, '', '1_Access', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 14:49:26.0', 1), 
 (141, null, '<p>\n\tThe graphic interface of the <span>Welcome</span> screen is composed by <em><span>eight </span></em><strong>(8) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA banner with label <span>JPetStore Demo</span></li>\n\t<li>\n\t\tA <span>Cart</span> icon <img alt=\"\" src=\"data:image/pnbase64,\" /></li>\n\t<li>\n\t\tA <span>Sign-in</span> link = switch to <span>Sign-out</span> when a user has loged in.</li>\n\t<li>\n\t\tA <span>?</span> link</li>\n\t<li>\n\t\tA text field and a link <span>Search</span></li>\n\t<li>\n\t\tA horizontal link bar <span>Fish / Dogs / Reptiles / Cats / Birds</span></li>\n\t<li>\n\t\tA vertical menu with <span>Fish / Dogs / Reptiles / Cats / Birds</span></li>\n\t<li>\n\t\tA central parrot image - link</li>\n</ol>\n', 'Interface - Welcome', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:27:53.0', 1), 
 (142, null, '<p>\n\tUsing an unallowed password returns an <span>error message</span> :</p>\n<p>\n\t</p>\n<p>\n\t<strong><span>Error!</span></strong></p>\n<p>\n\t<strong><span>Invalid username or password. Signon failed.</span></strong></p>\n', 'Wrong password', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:27:40.0', 1), 
 (143, null, '<p>\n\tThe graphic interface of the <span>Welcome</span> screen is composed by <em><span>eight </span></em><strong>(8) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA text <span>Welcome ...</span></li>\n\t<li>\n\t\tA <span>Sign-out</span> when a user has loged in.</li>\n\t<li>\n\t\tA <span>MyAccount</span> link</li>\n</ol>\n', 'Interface - Homepage', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:27:48.0', 1), 
 (144, null, '<p>\n\tThe graphic interface of the Authorisation screen is composed by <em><span>eight </span></em><strong>(8) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA text : <span>Please enter your username and password.</span></li>\n\t<li>\n\t\tA text box with label <span>Username</span><span>:</span></li>\n\t<li>\n\t\tA text box with label <span>Password :</span></li>\n\t<li>\n\t\tA button <span>SUBMIT</span></li>\n\t<li>\n\t\tA button <span>REGISTER NOW</span></li>\n</ol>\n', 'Interface - Authorisation', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:27:44.0', 1), 
 (145, null, '<p>\n\t<span><strong><u>NX Pet Shop</u></strong> </span>should be accessible through :</p>\n<ul>\n\t<li>\n\t\tFirefox 4.0.x</li>\n\t<li>\n\t\tInternet Explorer 7.0.x</li>\n</ul>\n<p>\n\tOther browser or older versions are <span>NOT</span> allowed.</p>\n', 'Browser', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:27:35.0', 1), 
 (146, null, '<p>\n\t<span class=\"short_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">A</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">click</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">on</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the</span> <span>REGISTER</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">button</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">will open</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">a</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">form page.</span></span></p>\n', 'Opening a page form', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:17.0', 1), 
 (147, null, '<p>\n\tClicking on :</p>\n<ol>\n\t<li>\n\t\twith the default user login : the SUBMIT button sends to the <span>Homepage</span> screen.</li>\n\t<li>\n\t\twith a new user login : the REGISTER NOW button sends to the <span>User information</span> screen.</li>\n</ol>\n', 'Navigation - Authorisation', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:05.0', 1), 
