 (149, null, '<p>\n\tClicking on :</p>\n<ol>\n\t<li>\n\t\tthe horizontal link bar sends to the <span>Catalogue</span> screen.</li>\n\t<li>\n\t\the menu sends to each animal <span>Catalogue</span> screen.</li>\n\t<li>\n\t\tthe parrot sends to each animal <span>Catalogue</span> screen.</li>\n\t<li>\n\t\tthe cart sends to the Cart screen.</li>\n\t<li>\n\t\tthe <span>Sign-in</span> link sends to the <span>Authorisation</span> screen.</li>\n\t<li>\n\t\tSearch with a name written down in the text field sends to the <span>Detailed Catalogue</span> screen.</li>\n\t<li>\n\t\tthe ? sends to the Help screen.</li>\n</ol>\n', 'Navigation - Welcome', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:12.0', 1), 
 (150, null, '<p>\n\t<span id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\"><span>MyAccount</span></span> link <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">is not</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">accessible</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">directly</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">from</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the homepage</span></span></p>\n', 'MyAccount Link', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:00.0', 1);
