 (152, null, '<p>\n\tThe graphic interface of the New user form screen is composed by <em><span>twenty two </span></em><strong>(22) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA block with label <span>User information</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>User ID :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>New password :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Repeat password :</span></li>\n\t<li>\n\t\tA block with label <span>Account </span><span>information</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>First name :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Last name :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Email :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Phone :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Address 1 :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Address 2 :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>City :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>State :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Zip :</span></li>\n\t<li>\n\t\tInside it : a text box with label <span>Country :</span></li>\n\t<li>\n\t\tA block with label <span>Profile Information</span></li>\n\t<li>\n\t\tInside it : one combo box labelled <span>Language Preference :</span></li>\n\t<li>\n\t\tInside it : one combo box labelled <span>Favorite category :</span></li>\n\t<li>\n\t\tInside it : one checkbox labelled <span>Enable MyList</span></li>\n\t<li>\n\t\tInside it : one checkbox labelled <span>Enable MyBanner</span></li>\n\t<li>\n\t\tA button <span>SUBMIT</span></li>\n\t<li>\n\t\tA link <span>My order</span></li>\n</ol>\n', 'Interface - New user form', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:29.0', 1), 
 (153, null, '<p>\n\tThe combo box <span>Favourite category</span> contains five pet categories :</p>\n<ol>\n\t<li>\n\t\tbirds</li>\n\t<li>\n\t\tcats</li>\n\t<li>\n\t\tdogs</li>\n\t<li>\n\t\tfish</li>\n\t<li>\n\t\treptiles</li>\n</ol>\n', 'Favourite category', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:25.0', 1), 
