 (155, null, '<p>\n\tThe combo box <span>Language Preference :</span> contains two languages :</p>\n<ol>\n\t<li>\n\t\tEnglish</li>\n\t<li>\n\t\tJapanese</li>\n</ol>\n', 'Language available', 'nf', '2011-05-24 14:49:26.0', 'guest_tpl', '2011-06-14 14:53:07.0', 1), 
 (156, null, '', '3_Modify an account', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 14:49:26.0', 1), 
 (157, null, '<p>\n\tThe repeat password <span><strong>MUST </strong></span>be the same than the new password.</p>\n', 'New - repeat password', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:28:36.0', 1), 
 (158, null, '', '4_Search into the catalogue', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 14:49:26.0', 1), 
 (159, null, '<p>\n\tThe graphic interface of the Pet catalogue screen is composed by <em><span>twenty two </span></em><strong>(22) </strong>elements :</p>\n<ol>\n\t<li>\n\t\tA link Main Menu</li>\n\t<li>\n\t\tThe screen title by the name of the pet (ie : <span>Dogs</span>)</li>\n\t<li>\n\t\tA table :</li>\n\t<li>\n\t\tInside it : two columns labeled <span>Product ID</span> and <span>Name</span></li>\n\t<li>\n\t\tInside it : each product id is a link.</li>\n\t<li>\n\t\tAt the bottom of the table : a link Next</li>\n</ol>\n', 'Interface - Pet catalogue', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:30:05.0', 1), 
 (160, null, '<p>\n\tClicking on :</p>\n<ol>\n\t<li>\n\t\t<span>Main Menu</span> sends back to the <span>Homepage</span> screen.</li>\n\t<li>\n\t\t<span>Next</span> displays the following part of the table (if necessary).</li>\n\t<li>\n\t\tthe product id sends to the <span>Detailed Pet</span> screen.</li>\n</ol>\n', 'Navigation - Pet catalogue', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:30:08.0', 1), 
 (161, null, '<p>\n\tThe format of this id should be :</p>\n<ol>\n\t<li>\n\t\tCode letters of the kind of pet : ie FI for FISH</li>\n\t<li>\n\t\tCode letters of the size of the pet : ie SW for SMALL</li>\n\t<li>\n\t\t# : ie 1,2,3...</li>\n</ol>\n', 'Product ID format', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:30:11.0', 1), 
 (162, null, '', '5_Manage the basket', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 14:49:26.0', 1), 
 (163, null, '<p>\n\tOnce a <strong>User</strong> validate a command (<u><em>ie :</em></u> buy a pet in the store), a flow feeds the <span><u><strong>NX Bank</strong></u></span> database with the order and card informations.</p>\n<p>\n\t</p>\n<p>\n\tIn details :</p>\n<ol>\n\t<li>\n\t\tORDER ID</li>\n\t<li>\n\t\tDATE</li>\n\t<li>\n\t\tITEM ID</li>\n\t<li>\n\t\tTOTAL COST</li>\n\t<li>\n\t\tCARD NUMBER</li>\n\t<li>\n\t\tEXPIRY DATE</li>\n</ol>\n<p>\n\t<u>Note :</u> <em>For further details, check the requirements of NX Bank :</em></p>\n<p>\n\t</p>\n<p>\n\t<span><em>02_Verify a payment</em></span><span><em> / Flow from NX Pet Shop</em></span></p>\n', 'Flow to NX Bank', 'nf', '2011-05-24 14:49:26.0', 'nf', '2011-05-24 15:30:15.0', 1), 
 (164, null, '', '6_Free search', 'nf', '2011-05-24 14:49:32.0', 'nf', '2011-05-24 14:49:32.0', 1), 
 (165, null, '<p>\n\tThe text box labelled <span>Search</span> in the right upper part is editable.</p>\n<p>\n\t</p>\n', 'Editable text box', 'nf', '2011-05-24 14:49:32.0', 'nf', '2011-05-24 14:52:37.0', 1), 
 (166, null, '<p>\n\tThe user initiate a search :</p>\n<ol>\n\t<li>\n\t\tWith something written down in the text box.</li>\n\t<li>\n\t\tBy clicking on <span>Search</span> OR hitting <span>Enter</span>. If the text box is empty, nothing happens.</li>\n</ol>\n', 'Initiate a search', 'nf', '2011-05-24 14:49:32.0', 'nf', '2011-05-24 15:30:23.0', 1), 
