 (60, '2011-05-17 14:52:30.0', '<p>\n\ttoto</p>', 'toto', 'nf', '2011-05-17 14:40:10.0', null, null, 1), 
 (61, '2011-05-17 16:48:02.0', '<p>\n\t<span class=\"short_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">access the</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">account creation by clicking the button MyAccount</span></span></p>\n', 'Access the account creation', 'anonymousUser', '2011-05-17 15:05:05.0', 'anonymousUser', '2011-05-17 16:21:57.0', 1), 
 (62, '2011-05-24 14:27:09.0', '<p>\n\tThis is the nominal case (<span>without errors</span>) where the <strong>Banker</strong> connects to <span><strong><u>NX Bank</u></strong></span>.</p>\n<p>\n\t</p>\n<p>\n\tIn this nomminal case, we also check :</p>\n<ul>\n\t<li>\n\t\tthe interface.</li>\n\t<li>\n\t\tthe navigation from this screen.</li>\n</ul>\n', '01_Banker connects', 'nf', '2011-05-17 16:24:31.0', 'nf', '2011-05-18 12:53:56.0', 2), 
 (63, '2011-05-17 16:49:45.0', '', '01_Highlight the button MyAccount', 'anonymousUser', '2011-05-17 16:44:00.0', 'anonymousUser', '2011-05-17 16:48:20.0', 1), 
