 (65, '2011-05-18 14:47:00.0', '<p>\n\tAccess the account creation by clicking the button MyAccount</p>\n', '02_Create an account', 'id', '2011-05-17 17:05:18.0', 'anonymousUser', '2011-05-18 14:44:20.0', 1), 
 (66, '2011-05-24 14:27:09.0', '<p>\n\tIn this case, a Non Banker connects to <span><strong><u>NX Bank</u></strong></span>.</p>\n<p>\n\t</p>\n<p>\n\tThis should returns an <span>error message</span>.</p>\n', '03_Non Banker connects', 'nf', '2011-05-17 17:14:20.0', 'nf', '2011-05-19 13:56:20.0', 2), 
 (67, '2011-05-24 14:27:09.0', '<p>\n\tIn this case, we check the browser and its version.</p>\n<p>\n\t</p>\n<p>\n\tIt should be <span>impossible to connect</span> with an unallowed browser, or with a wrong version of an allowed browser.</p>\n', '02_Browser', 'nf', '2011-05-17 17:23:31.0', 'nf', '2011-05-19 13:56:15.0', 2), 
 (68, '2011-05-24 14:27:09.0', '<p>\n\tIn this case, i check the limit of <strong><em>twelve</em> (12)</strong> characters.</p>\n<p>\n\t</p>\n<p>\n\tIt should returns an <span>error message</span>.</p>\n', '04_Controls', 'nf', '2011-05-17 17:25:01.0', 'nf', '2011-05-19 13:56:25.0', 2), 
 (69, '2011-05-24 14:27:09.0', '<p>\n\tIn this case, a Banker connects to <span><strong><u>NX Bank</u></strong></span> with a <span>wrong </span>Login or Password.</p>\n<p>\n\t</p>\n<p>\n\tThis should returns an <span>error message</span>.</p>\n', '06_Wrong Login Password', 'nf', '2011-05-17 17:31:26.0', 'nf', '2011-05-19 13:56:37.0', 2), 
 (70, '2011-05-24 14:27:09.0', '<p>\n\tIn this case, a Banker connects to <span><strong><u>NX Bank</u></strong></span> with an <span>incomplete </span>Login Password</p>\n<p>\n\t</p>\n<p>\n\tThis should returns an <span>error message</span>.</p>\n', '05_Incomplete Login Password', 'nf', '2011-05-17 17:32:24.0', 'nf', '2011-05-19 13:56:31.0', 2), 
