 (72, '2011-05-24 14:29:29.0', '<p>\n\t<span id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">There is</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">a</span> registred <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">user</span><span title=\"Cliquer ici pour voir d''autres traductions\">.</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">The</span> later <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">connection</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">can</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">be made via the</span> registred user<span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">.</span></span></p>\n', '112_Connection with a user account', 'anonymousUser', '2011-05-18 11:30:09.0', 'anonymousUser', '2011-05-20 13:38:26.0', 1), 
 (73, '2011-05-24 14:29:29.0', '<p>\n\t<span class=\"short_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">Using</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">a</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">wrong password</span></span></p>\n', '121_Invalid_password', 'anonymousUser', '2011-05-18 15:32:30.0', 'anonymousUser', '2011-05-20 13:38:54.0', 1), 
