 (76, '2011-05-24 14:29:29.0', '<p>\n\t<span class=\"short_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">Change</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">password</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">of</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">the</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">account</span> <span class=\"hps\" title=\"Cliquer ici pour voir d''autres traductions\">connection</span></span></p>\n', '311_Modify_password', 'anonymousUser', '2011-05-18 15:59:11.0', 'anonymousUser', '2011-05-20 13:39:23.0', 1), 
